INSERT INTO tb_product (name, price, date, description, img_url) VALUES ('Traker', 491650.0, TIMESTAMP WITH TIME ZONE '2020-07-14T10:00:00Z', 'Motor três cilindros em linha 1.2, 12V, duplo comando variável, turbo, start-stop Cilindrada 1200 cm³ Combustível flex  Potência: 132 cv e 133 cv a 5.500 rpm Torque 19,4 kgfm e 21,4 kgfm a 2.000 rpm Câmbio utomático, seis marchas Direção elétrica Suspensão MacPherson e eixo de torção Freios Disco ventilado e tambor Tração Dianteira Dimensões 4,270 m , 1,791 m , 1,626 m  Entre-eixos 2,570 m Pneus 215/55 R17 Porta-malas 393 litros (357+36 sob o assoalho) Tanque 44 litros Peso 1.271 kg 0-100 km/h 11s7 Velocidade máxima 175 km/h Consumo cidade 11,2 km/l e 7,7 km/l consumo estrada 13,5 km/l e 9,4 km/l Emissão de CO2 111 g/km Nota do Inmetro B Classificação na categoria (SUV Compacto)', 'https://motorshow.com.br/wp-content/uploads/sites/2/2020/06/tres-quartos-frente-tracker_1280x960-1-e1592336290754-696x564.jpg');
INSERT INTO tb_product (name, price, date, description, img_url) VALUES ('Mustang Mach', 589680.0, TIMESTAMP WITH TIME ZONE '2020-07-14T10:00:00Z', 'A edição limitada carrega consigo o legado histórico de performance com a utilização de diversos componentes dos modelos Shelby® GT350 e GT500. O motor 5.0 V8 com novo Sistema de admissão e 483cv, a transmissão automática de 10 velocidades com nova calibração e o sistema de arrefecimento ainda mais eficiente ajudam você a extrair o máximo de performance em qualquer condição.', 'https://newsletter.dimas.com.br/uploads/automoveis_veiculos/25/imagens_todas/grande_2c05b07f74308cfb89c6c2468847476d.jpg');
INSERT INTO tb_product (name, price, date, description, img_url) VALUES ('Camaro SS Coupé', 214850.0, TIMESTAMP WITH TIME ZONE '2020-07-14T10:00:00Z', 'A potência do esportivo, se mantém o motor V8 6.2 litros de 426 cv e 58.09 kgmf de torque na versão com transmissão manual de seis velocidades. Enquanto os modelos automáticos, também com seis velocidade, contam com 400 cv e 56,7 kgmf de torque.', 'https://quatrorodas.abril.com.br/wp-content/uploads/2016/11/5658c5d8cc505d14c82830ec2014-sema-chevrolet-camaro-ss-1.jpeg?quality=70&strip=all');
INSERT INTO tb_product (name, price, date, description, img_url) VALUES ('Camaro SS Conversivel', 279250.0, TIMESTAMP WITH TIME ZONE '2020-07-14T10:00:00Z', 'O motor permanece é o mesmo V-8 6.2 de 461 cv de potência e 62,9 kgfm de torque, mas agora acoplado a um câmbio de 10 marchas e não o de 8; o câmbio é a mesmo de seu grande rival histórico, o Mustang, e foi desenvolvido pelas duas fabricantes, GM e Ford.', 'https://revistacarro.com.br/wp-content/uploads/2019/02/Camaro-7.jpg');
INSERT INTO tb_product (name, price, date, description, img_url) VALUES ('Troller T4', 175350.0, TIMESTAMP WITH TIME ZONE '2020-07-14T10:00:00Z', 'O modelo é equipado com o motor 3.2 Diesel Duratorq com 200 cv de potência e torque de 47,9 kgfm. O Troller T4 2020 segue sendo ofertado somente com transmissão manual de seis velocidades O SUV raiz tem tração 4×4 com comando eletrônico no console. As opções são 4×2, 4×4 Low e 4×4 High. Ele é equipado também com diferencial traseiro autoblocante com sistema Trac-Lock, que transfere o torque para a roda com maior aderência e compensa variações do piso.', 'https://quatrorodas.abril.com.br/wp-content/uploads/2017/03/mgbf6421.jpg?resize=650,524');
INSERT INTO tb_product (name, price, date, description, img_url) VALUES ('Pajero TR4', 52470.0, TIMESTAMP WITH TIME ZONE '2020-07-14T10:00:00Z', 'O TR4 nacional chegou com motor 4G94 2.0 SOHC movido por gasolina, que entregava 131 cavalos a 5.500 rpm e 18 kgfm a 4.500 rpm. O câmbio era manual de cinco marchas e havia opção de tração 4×2 ou 4×4 com reduzida', 'https://cdn.buttercms.com/M4b3zzALQMGE4S8PgCKs');
